'declare ',
'   tab apex_application_global.vc_arr2; ',
'   person_cnt pls_integer; ',
'begin ',
'   APEX_COLLECTION.CREATE_OR_TRUNCATE_COLLECTION( ',
'      p_collection_name => ''P12COL''); ',
'   tab := apex_util.string_to_table (:p8_employees);',
'',
'   FOR i IN 1 .. tab.count LOOP ',
'      APEX_COLLECTION.ADD_MEMBER(',
'          p_collection_name => ''P12COL'', ',
'          p_c001 => tab(i) );',
'   END LOOP; ',
'',
'   insert into NL_members (DATE_ADDED, LIST_SEQ_ID, ACTIVE_EMPLOYEES_EMPLOYEE_ID) ',
'      select :P8_DATE_ADDED, :P8_LIST_SEQ_ID, c001 ',
'      from apex_collections where collection_name = ''P12COL'' and ',
'         not exists (select 1 from NL_MEMBERS o where o.active_employees_employee_id = c001  ',
'            and o.list_seq_id = :P8_LIST_SEQ_ID); ',
'',
'   delete from NL_MEMBERS where ',
'      LIST_SEQ_ID = :P8_LIST_SEQ_ID and',
'      not exists (select 1 from apex_collections',
'                  where collection_name = ''P12COL'' and ACTIVE_EMPLOYEES_EMPLOYEE_ID = c001); ',
'end;'))
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
);
