' v_char      CHAR(1);',
' c_chunk_len   number       := 1;',
' v_line        VARCHAR2 (32767)        := NULL;',
' v_data_array      wwv_flow_global.vc_arr2;',
' v_rows number;',
'BEGIN',
'-- Read data from wwv_flow_files',
' select blob_content into v_blob_data',
' from wwv_flow_files',
' where created_on = (select max(created_on) from wwv_flow_files)',
' and id = (select max(id) from wwv_flow_files) ;',
' ',
'v_blob_len := dbms_lob.getlength(v_blob_data);',
'v_position := 1;',
' ',
' wwv_flow.debug(v_blob_len);',
' ',
'-- Read and convert binary to char',
'WHILE ( v_position <= v_blob_len ) LOOP',
'  v_raw_chunk := dbms_lob.substr(v_blob_data,c_chunk_len,v_position);',
'',
'  v_char :=  chr(hex_to_decimal(rawtohex(v_raw_chunk)));',
'  v_position := v_position + c_chunk_len;',
'',
'  -- When a whole line is retrieved ',
'  IF v_char = CHR(13) or v_char = CHR(10) THEN',
'    -- Convert comma to : to use wwv_flow_utilities ',
'    v_line := REPLACE (v_line, '','', '':'');',
'    wwv_flow.debug(v_line);',
'',
'    -- Convert each column separated by : into array of data ',
'    v_data_array := wwv_flow_utilities.string_to_table (v_line);',
'    ',
'    -- Insert data into target table ',
'    INSERT into Active_Employees(employee_id, name, lab, division, status,',
'           status_eff_date, admin, network_account_id, created, created_by,',
'            row_version_number, updated, updated_by)',
'    VALUES (v_data_array(1), v_data_array(2), v_data_array(3), v_data_array(4),',
'           v_data_array(5), v_data_array(6), v_data_array(7), v_data_array(8),',
'           v_data_array(9), v_data_array(10), v_data_array(11), v_data_array(12),',
'           v_data_array(13));',
'    -- use the v_data_array array to get the values from that line of the CSV',
'    -- for example, v_data_array(1) is the first value in a line of the CSV',
'',
'    -- Clear out',
'    v_line := NULL;',
'  ELSE',
'    v_line := v_line || v_char;',
'  END IF;',
' ',
'END LOOP;',
'END;'))
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_api.id(3676338550974390962)
,p_process_success_message=>'Success'
);
end;
